import React, { Component } from 'react';
import CanvasJSReact from './canvasjs.react';
var CanvasJSChart = CanvasJSReact.CanvasJSChart;

class SplineAreaChart extends Component {
  constructor(props) {
    super(props);
      this.state = {
         image:100,
         pdf:200
      }

  }
	render() {
		const options = {
			animationEnabled: true,
			title: {
				text: "Graph showing the uploaded File Type"
			},
			axisY: {
				title: "Net Generation (in Billion kWh)",
				includeZero: false,
				suffix: " kWh"
			},
			data: [{
				type: "splineArea",
				xValueFormatString: "YYYY",
				yValueFormatString: "#,##0.## bn kW⋅h",
				showInLegend: true,
				legendText: "kWh = one kilowatt hour",
				dataPoints: [
					{ x: 'Image', y: this.state.image },
					{ x: 'Pdf', y: this.state.pdf },

				]
			}]
		}

		return (
		<div style={{marginTop:'50px'}}>

			<CanvasJSChart options = {options} 
				/* onRef={ref => this.chart = ref} */
			/>
			{/*You can get reference to the chart instance as shown above using onRef. This allows you to access all chart properties and methods*/}
		</div>
		);
	}
}

export default SplineAreaChart;
